import React from 'react';

const ChildComponent = ({ onLog }) => {
  // Function to log something
  const logSomething = (message) => {
    onLog(message);
  };

  return (
    <div>
      <h2>Child Component</h2>
      <button onClick={() => logSomething("Hello from ChildComponent!")}>
        Log from Child
      </button>
    </div>
  );
};


const RentalForm = () => {
  // Function to handle logging from child
  const handleLogFromChild = (message) => {
    console.log(message);
  };

  return (
    <div>
      <h1>Parent Component</h1>
      <ChildComponent onLog={handleLogFromChild} />
    </div>
  );
};

export default RentalForm;
